    public int lengthOfLongestSubstring1(String s) {
        HashSet<Character> sets = new HashSet<>();
        int max = 0;
        int len = s.length();
        for (int i = 0; i < len; i++) {
            for (int j = i; j < len; j++) {

                Character ch = s.charAt(j);
                if (sets.contains(ch)) {
                    // 存在相同，终止，返回个数
                    if (sets.size() > max) {
                        max = sets.size();
                    }
                    sets.clear();
                    // 添加当前元素
                    sets.add(ch);


                } else {
                    sets.add(ch);
                }
            }
            // 最后一轮元素判断：最后一个元素还没冲突
            if (sets.size() > max) {
                max = sets.size();
            }
            // 清空set
            sets.clear();

        }

        return max;
    }

